import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
class Circle extends Component{
  render(){
    var style={
      width:100,
      height:100,
      borderRadius:50,
      color:"red",
      bordr:2,
      border:"white"
    }
    return(<div styel={this.style}></div>)
  }
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <Circle />
        </header>
      </div>
    );
  }
}

export default App;
